    /**
     * [$tad description]
     * @var object Holds the TAD object
     */
    private $tad;

    /**
     * [$connected_device description]
     * @var array Holds the connected device table
     */
    private $connected_device;

    /**
     * Here is the inicialization of the tad object depending
     * on the connected table state.
     */
    public function __construct()
    {
        $this->connected_device = Connected::find(1);

        if ($this->connected_device['connected'] == 1) {
            $tadf = new TADFactory(['ip' => $this->connected_device['ip_address']]);
            $this->tad = $tadf->get_instance();
        } else {
            $this->tad = null;
        }

    }

    private function key_change(array $a, array $list = [])
    {
        foreach ($a as $row) {
            for ($i = 0; $i < count($list) - 1; $i++) {
                $row[$list[$i]] = $row[$i];
                if (array_key_exists($list[$i], $row)) {
                    unset($row[$i]);
                }

            }
        }

        return $a;
    }

    /**
     * Gets all att. record from the connected device and no
     * sorting is applied. Returns only the new ones.
     * @return [type] [description]
     */
    public function getAll()
    {
        if ($this->tad && $this->tad->is_alive()) {
            $data = $this->tad->get_att_log()->to_array();
            $data = $data['Row'];

            // $device = Device::where('ip_address', $this->connected_device['ip_address'])->first();

            $last_log = Log::where('device_id', $this->connected_device['device_id'])->orderBy('id', 'desc')->first();
            $last_log_datetime = null;
            if ($last_log) {
                $last_log_datetime = Carbon::parse($last_log->datetime);
            };

            $return_data = [];
            $timestamp = Carbon::now()->toDateTimeString();

            foreach ($data as $k => $v) {
                if (($last_log_datetime === null) || ($last_log_datetime->lt(Carbon::parse($data[$k]['DateTime'])))) {
                    $data[$k]['emp_id'] = $data[$k]['PIN'];
                    unset($data[$k]['PIN']);
                    $data[$k]['datetime'] = $data[$k]['DateTime'];
                    unset($data[$k]['DateTime']);
                    $data[$k]['verified'] = $data[$k]['Verified'];
                    unset($data[$k]['Verified']);
                    $data[$k]['status'] = $data[$k]['Status'];
                    unset($data[$k]['Status']);
                    $data[$k]['workcode'] = $data[$k]['WorkCode'];
                    unset($data[$k]['WorkCode']);
                    $data[$k]['device_id'] = $this->connected_device['device_id'];
                    $data[$k]['created_at'] = $timestamp;
                    $data[$k]['updated_at'] = $timestamp;

                    array_push($return_data, $data[$k]);
                }
            }

            return $return_data;
        }
    }

    public function getBig()
    {
        $data = json_decode($this->bigdata, true);
        foreach ($data as $k => $v) {

            $datetime = Carbon::now()->toDateTimeString();

            $data[$k]['emp_id'] = $data[$k]['PIN'];
            unset($data[$k]['PIN']);
            $data[$k]['datetime'] = $data[$k]['DateTime'];
            unset($data[$k]['DateTime']);
            $data[$k]['verified'] = $data[$k]['Verified'];
            unset($data[$k]['Verified']);
            $data[$k]['status'] = $data[$k]['Status'];
            unset($data[$k]['Status']);
            $data[$k]['workcode'] = $data[$k]['WorkCode'];
            unset($data[$k]['WorkCode']);
            $data[$k]['device_id'] = 2;
            $data[$k]['created_at'] = $datetime;
            $data[$k]['updated_at'] = $datetime;
        }

        // $all_logsChunks = array_chunk($data, 3000);
        // return ($all_logsChunks[0]);

        return $data;

    }

    /**
     * Gets and sorts the logs data by DateTime key
     * @return array $data
     */
    private function DataSort()
    {
        if ($this->tad && $this->tad->is_alive()) {
            $data = $this->tad->get_att_log()->to_array();
            $data = $data['Row'];
            usort($data, function ($a1, $a2) {
                $v1 = strtotime($a1['DateTime']);
                $v2 = strtotime($a2['DateTime']);
                return $v1 - $v2; // $v2 - $v1 to reverse direction
            });

            return $data;
        }

        return null;
    }

    /**
     * Gets all attendance logs from the conected device
     * @return array of all logs
     */
    public function getRecordAll()
    {
        return $this->DataSort();
    }

    /**
     * Gets all attendance logs from the connected device
     * and formats as html table row output
     * @return string of table rows with data
     */
    public function getRecordAllHtml()
    {
        $data = $this->DataSort();
        $i = 1;
        if ($data) {
            foreach ($data as $row) {
                echo '<tr>' .
                '<td>' . $i++ . '</td>' .
                    '<td>' . $row['PIN'] . '</td>' .
                    '<td>' . $row['DateTime'] . '</td>' .
                    '<td>' . $row['Verified'] . '</td>' .
                    '<td>' . $row['Status'] . '</td>' .
                    '<td>' . $row['WorkCode'] . '</td>' .
                    '</tr>';
            }

        }
    }

    /**
     * Creates and return array of logs with DateTime grater than or equal to
     * start of the day in well defined time. In this case 06h AM
     * @return array [new array]
     */
    public function getRecordToday()
    {
        $data = $this->DataSort();
        if ($data) {
            $startShift = Carbon::now()->startOfDay()->addHours(6); // 6 will be read from DB
            $endShift = Carbon::now()->startOfDay()->addHours(16);
            // dd(compact('startShift', 'endShift'));

            $newData = [];

            foreach ($data as $date) {
                $curr = Carbon::parse($date['DateTime']);
                // dd($curr);
                if ($curr->between($startShift, $endShift)) {
                    // if(($curr->gte($startShift)) && ($curr->lte($endShift))) {
                    array_push($newData, $date);
                }
            }

            return $newData;
        }
    }

    /**
     * Creates and returns a html formated array of logs with DateTime
     * grater than or equal to start of the day in well
     * defined time. In this case 06h AM
     * @return string of table rows with data
     */
    public function getRecordTodayHtml()
    {
        $data = $this->getRecordToday();
        $i = 1;
        if ($data) {
            foreach ($data as $row) {
                echo '<tr>' .
                '<td>' . $i++ . '</td>' .
                    '<td>' . $row['PIN'] . '</td>' .
                    '<td>' . $row['DateTime'] . '</td>' .
                    '<td>' . $row['Verified'] . '</td>' .
                    '<td>' . $row['Status'] . '</td>' .
                    '<td>' . $row['WorkCode'] . '</td>' .
                    '</tr>';
            }
        }

    }

    /**
     * Creates and return array of logs with DateTime grater than or equal to
     * the past 24h
     * @return array [new array]
     */
    public function getRecord24h()
    {
        $data = $this->DataSort();
        if ($data) {
            $pastDay = Carbon::now()->addDays(-1);

            $newData = [];

            foreach ($data as $date) {
                $curr = Carbon::parse($date['DateTime']);
                if ($curr->gte($pastDay)) {
                    array_push($newData, $date);
                }
            }

            return $newData;
        }
    }

    /**
     * Creates and returns a html formated array of logs with DateTime
     * grater than or equal to the past 24h
     * @return string of table rows with data
     */
    public function getRecord24hHtml()
    {
        $data = $this->getRecord24h();
        $i = 1;
        if ($data) {
            foreach ($data as $row) {
                echo '<tr>' .
                '<td>' . $i++ . '</td>' .
