                    '<td>' . $row['DateTime'] . '</td>' .
                    '<td>' . $row['Verified'] . '</td>' .
                    '<td>' . $row['Status'] . '</td>' .
                    '<td>' . $row['WorkCode'] . '</td>' .
                    '</tr>';
            }
        }

    }

